import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background: linear-gradient(135deg, #6a11cb 0%, #2575fc 100%);
  color: white;
  text-align: center;
`;

const Title = styled.h1`
  font-size: 3rem;
  margin-bottom: 20px;
  font-family: 'Arial', sans-serif;
`;

const Description = styled.p`
  font-size: 1.5rem;
  font-weight: 300;
  line-height: 1.6;
  max-width: 600px;
  font-family: 'Verdana', sans-serif;
`;

const Home = () => {
  return (
    <HomeContainer>
      <Title>Welcome to the Home Page</Title>
      <Description>This is the starting page of the application, designed to provide an introduction and guide you through the platform.</Description>
    </HomeContainer>
  );
};

export default Home;
